import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";

function App() {
  return <div className="App">
    <Router>

        <Route path="/" exact component ={Home} />

    </Router>
  </div>
}

export default App;
